package Z421_440;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 * @Author wb-zyf471922
 * @Date 2018/12/28 13:31
 **/
public class FindAllAnagramsInAString438 {

    public static void main(String[] args) {
        String s = "";

        String p = "";

        System.out.println(new FindAllAnagramsInAString438().findAnagrams(s, p));
    }
    /**
     *
     * @param s
     * @param p
     * @return
     */
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> resultList = new ArrayList<>();

        int len1 = s.length();
        int len2 = p.length();
        if (len1 < len2) {
            return resultList;
        }

        Map<Character, Integer> map2 = getStrMap(p);
        Map<Character, Integer> map1 = getStrMap(s.substring(0, len2));
        if (isAnagram(map1, map2)) {
            resultList.add(0);
        }

        for (int i = 1; i <= len1 - len2; i++) {
            char ch = s.charAt(i - 1);
            int value = map1.get(ch);
            if (value - 1 == 0) {
                map1.remove(ch);
            } else {
                map1.put(ch, map1.get(ch) - 1);
            }
            map1.merge(s.charAt(i + len2 - 1), 1, Math::addExact);

            if (isAnagram(map1, map2)) {
                resultList.add(i);
            }
        }

        return resultList;
    }

    private Map<Character, Integer> getStrMap(String s) {
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i <= s.length() - 1; i++) {
            map.merge(s.charAt(i), 1, Math::addExact);
        }

        return map;
    }

    public boolean isAnagram(Map<Character, Integer> map1, Map<Character, Integer> map2) {

        for (Map.Entry<Character, Integer> entry : map1.entrySet()) {
            Character key = entry.getKey();
            Integer value = entry.getValue();

            if (!value.equals(map2.get(key))) {
                return false;
            }
        }

        return true;
    }
}
